import React from 'react';
import PropTypes from 'prop-types';

function Backdrop({ onExit }) {
  return (
    <div className="backdrop" onClick={onExit} role="button" tabIndex="0" />
  );
}

Backdrop.propTypes = {
  onExit: PropTypes.func.isRequired,
};

export default Backdrop;
